import React from "react";

function FormSignup() {

    return(
        <div className="signup">
                <form className="form">
                    <label className="form-label"> <input className="form-input" type="text" placeholder="User Name" autoComplete="off" /></label>
                    
                    <input type="email" placeholder="Email Address" autoComplete="off" />
                    <input type="password" placeholder="Enter Password" autoComplete="off" />
                    <input type="text" placeholder="Confirm Password" autoComplete="off" />
                </form>
            </div>
    )
}

export default FormSignup
